// src/GamezopEmbed.js
import React from 'react';

const QuizComponent = () => {
  // const gameUrl = 'https://www.newszop.com/';
const gameUrl = 'https://play.gamezop.com/te/intro?int-nav=1'
  return (
    <div className="game-container">
      <header/>
      <iframe
        title="Gamezop Game"
        src={gameUrl}
        className="game-iframe"
      />
    </div>
  );
};

export default QuizComponent;
